var ciianalytics={endpoint:null,init:function(){this.endpoint=$("#endpoint").attr("data-attr-endpoint")+"/api/event",this.page()},page:function(){var t=this;this.ajax("_trackPageView",{content_id:t.getContentId(),uri:window.location.pathname,page_title:document.title})},track:function(t,e){var n=this;e.content_id=n.getContentId(),e.uri=e.uri||window.location.pathname,e.page_title=e.page_title||document.title,this.ajax(t,e)},getContentId:function(){return $("#content").attr("data-attr-id")||!1},ajax:function(t,e){var n=this;return e.event=t,$.post(n.endpoint,{Event:e})}};